        return <nav className="navbar navbar-expand-lg  navbar-dark bg-dark p-2 justify-content-between">
        <div className="navbar-brand colorp" >
            <i className="fas fa-poll-h icon text-light"></i>
            Dashbord~<span className="text-muted">Super admin ANOC</span>
        </div>
      </nav>
    }
}

export default Navbar
